&quot;Hawaaizaada&quot; is an upcoming Hindi film directed by Vibhu Puri. The film stars Ayushmann Khurrana, Mithun Chakraborty and Pallavi Sharda in pivotal roles. The film is based on the life of scientist Shivkar Bapuji Talpade. The film Will release on January 30, 2015.

